<template>
  <b-form @submit.prevent id="import-export-form">
    <b-form-group :label="$t('formLabelImportExportData')"
                  label-for="export-data">
      <b-form-textarea :rows="5" :readonly="true" id="export-data" :value="config" />
    </b-form-group>
    <b-button @click="exportJson">{{ storeDataset.uuid ? $t('buttonImportExportSave') : $t('buttonImportExportShare') }}</b-button>

    <div v-show="serverUuid !== null">
      <p class="text-info mt-3">{{ $t('modalTextExportQR') }}</p>
      <div ref="svg" id="qrcode" class="text-center" />
      <p class="text-center">{{ serverUuid }}</p>
      <p class="text-danger" v-if="serverError">{{ serverError }}</p>
    </div>
  </b-form>
</template>

<script>
import QRCodeStyling from 'qr-code-styling'

import { mapGetters } from 'vuex'

const imageData = 'data:image/svg+xml;base64,'

export default {
  data: function () {
    return {
      svg: null,
      serverUuid: null,
      serverError: null
    }
  },
  computed: {
    /** Mapgetters exposing the store configuration */
    ...mapGetters([
      'storeDataset',
      'storeData',
      'storeRows',
      'storeCols'
    ]),
    config: function () {
      if (!this.storeDataset || !this.storeDataset.data || this.storeDataset.data.length < 1) {
        return
      }
      let dataCopy = JSON.parse(JSON.stringify(this.storeDataset))
      const arrayData = []
      for (let row = 0; row < this.storeRows; row++) {
        const rowData = []
        for (let col = 0; col < this.storeCols; col++) {
          rowData.push(this.storeDataset.data.get(`${row}-${col}`))
        }
        arrayData.push(rowData)
      }
      delete dataCopy.data
      dataCopy.data = arrayData
      if (this.serverUuid) {
        dataCopy.uuid = this.serverUuid
      }
      return JSON.stringify(dataCopy)
    },
    shareUrl: function () {
      if (this.serverUuid) {
        const uuidPart = this.$router.resolve({ name: 'uuid-import', params: { uuid: this.serverUuid } }).resolved.path
        let origin = window.location.origin
        let pathname = window.location.pathname

        if (origin.lastIndexOf('/') === origin.length - 1) {
          origin = origin.substring(0, origin.length - 1)
        }
        if (pathname.length > 0 && pathname[0] === '/') {
          pathname = pathname.substring(1)
        }
        if (pathname.lastIndexOf('/') === pathname.length - 1) {
          pathname = pathname.substring(0, pathname.length - 1)
        }

        if (pathname.length > 0) {
          pathname = pathname + '/'
        }

        return origin + '/' + pathname + '#' + uuidPart
      } else {
        return null
      }
    }
  },
  watch: {
    shareUrl: function (newValue) {
      if (newValue) {
        this.$nextTick(() => {
          if (!this.codeWriter) {
            this.codeWriter = new QRCodeStyling({
              width: 300,
              height: 300,
              data: newValue,
              dotsOptions: {
                type: 'rounded'
              },
              imageOptions: {
                hideBackgroundDots: true,
                imageSize: 0.4,
                margin: 10
              },
              image: imageData
            })
            this.codeWriter.append(this.$refs.svg)
          } else {
            this.codeWriter.update({
              data: newValue
            })
            this.codeWriter.append(this.$refs.svg)
          }
        })
      } else {
        // TODO
      }
    }
  },
  methods: {
    reset: function () {
      this.svg = null
      this.serverUuid = null
      this.serverError = null
    },
    exportJson: function () {
      this.postConfigForSharing(this.config)
        .then(result => {
          if (result && result.data) {
            this.serverUuid = result.data

            this.$store.dispatch('setDatasetUuid', result.data)
          } else {
            this.serverUuid = null
          }
        })
        .catch(err => { this.serverError = err })
    }
  },
  mounted: function () {
    this.reset()
  }
}
</script>

<style>
#import-export-form .form-group textarea {
  border-bottom-left-radius: 0;
  border-bottom-right-radius: 0;
}
#import-export-form .form-group textarea + .b-form-file * {
  border-top: 0;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
</style>
